import React, { Component } from "react";
import { Grid, IconButton, CardMedia } from "@material-ui/core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faChevronLeft,
  faChevronRight
} from "@fortawesome/free-solid-svg-icons";
import "./Home.css";

class Home extends Component {
  state = {
    urlImage:
      "https://images-na.ssl-images-amazon.com/images/I/7177FQIcHBL._UL1500_.jpg"
  };
  render() {
    return (
      <div>
        <CardMedia
          image={this.state.urlImage}
          width="100%"
          style={{
            height: 500
          }}
        >
          <Grid
            container
            direction="row"
            style={{
              alignContent: "center",
              alignItems: "center",
              justifyContent: "space-between",
              flexGrow: 1
            }}
          >
            <IconButton onClick={this.handleBackClick}>
              <FontAwesomeIcon style={{ color: "grey" }} icon={faChevronLeft} />
            </IconButton>
            <IconButton onClick={this.handleNextClick}>
              <FontAwesomeIcon
                style={{ color: "grey" }}
                icon={faChevronRight}
              />
            </IconButton>
          </Grid>
        </CardMedia>
      </div>
    );
  }

  handleBackClick() {
    console.log("handleBackClick");
  }

  handleNextClick() {
    console.log("handleNextClick");
  }
}

// const Home = withStyles(styles)(({ classes }) => (

// ));

export default Home;
